import { Menu } from "antd";
import React from "react";
import { Link } from "react-router-dom";
import {Layout} from 'antd'
const { Header } = Layout;

function Navigation() {
  return (
    <>
        <Layout className="layout">
      <Header>
        <div className="logo" />
        <Menu
          theme="dark"
          mode="horizontal"
          defaultSelectedKeys={['Home']}
          
        >
          <Menu.Item key={'Home'}>
          <Link to="/">Home</Link>
          </Menu.Item>
          <Menu.Item>
          <Link to="/">Home</Link>
          </Menu.Item>
        </Menu>
      </Header>
</Layout>
    </>
    // <div class="navbar flex justify-between items-center p-2 font-sans">
    //   <nav className="bg-slate-800 text-cyan-600 flex justify-center items-center md:order-2">
    //     <ul className="flex">
    //       <li>
    //         <Link to="/">Home</Link>
    //       </li>
    //       <li>
    //         <Link to="/login">Login</Link>
    //       </li>
    //       <li>
    //         <Link to="/login">Login</Link>
    //       </li>
    //     </ul>
    //   </nav>
    // </div>
  );
}

export default Navigation;
